import Header from "../Header/Header";
import MobileNavBar from "../MobileNavBar/MobileNavBar";

export default function ContactPage({ terms, onCatClick, category, onBurgerClick, onBurgerClose, isBurgerOpen }) {
  return (
    <>
      <Header 
      terms={terms}
      onCatClick={onCatClick}
      activeCategory={category}
      isBurgerOpen={isBurgerOpen}
      onBurgerClose={onBurgerClose}
      />
      <main className="contacts">
        <h1 className="">Контакты</h1>
        <div className="contacts-container">
          <div className="contacts_block_1">
            <div className="">
              8 (800) 200 17 05
            </div>
          </div>
          <div className="contacts_block_1">
            
          </div>
        </div>
      </main>
      <MobileNavBar
      onBurger={onBurgerClick} 
      isBurgerOpen={isBurgerOpen} 
      onBurgerClose={onBurgerClose}
      />
    </>
  )
}

